While I was on my vacation, I became very bored. I was on my own and the nightclubs were too far away for me to get too. So I went exploring. i found this little cottage in the countryside and I decided to go and have a closer look at it. Whilst I was walking around this cottage, one of the residence came out to find out what I was doing there. She was quite cute and holding a glass of champagne. I told her that I was on vacation and I had a lot of money. After some small talk, I offered her a lot of cash to her if she would have sex with me. When I told her that I would only last 10 minutes, she took me by the hand and led me to a private area of the garden.

